import React from "react";
import "./style/service.css";
function Service() {
  return (
    <div className="services" id="service">
      <h1>Our Services </h1>
      <div className="serviceContent">
        <div className="s-contentContainer">
          <img src="" alt="" />
          .
        </div>
      </div>
    </div>
  );
}

export default Service;
